import HomeBody from './HomeBody'
import LoginCon from './LoginCon'

const HomePage = ({ buttonCom }) => {

    return (

        <div className='row'>

            <div className='col-3'><LoginCon buttonCom={buttonCom} /></div>
            <div className='col-8'>  <HomeBody /></div>

        </div>
    )
}

export default HomePage
